    "**Overall Performance:**\n",
    "\n",
    "All models achieve relatively high accuracy scores, ranging from 0.840 (Logistic Regression) to 0.899 (Tuned Random Forest). This suggests they can correctly predict loan defaults most of the time.\n",
    "However, accuracy alone isn't always the best metric for imbalanced datasets, where loan defaults might be a smaller class. Precision and recall should also be considered.\n",
    "Model Comparison:\n",
    "\n",
    "1. Tuned Random Forest: Achieves the highest accuracy (0.899) and F1-score (0.721), indicating good overall performance and balance between precision and recall.\n",
    "2. Random Forest: Closely follows the tuned version with slightly lower scores, suggesting tuning might have helped but wasn't a major improvement.\n",
    "3. GBM: Both versions (tuned and original) perform similarly, with accuracy around 0.88 and F1-score around 0.68.\n",
    "4. Decision Tree: Both versions have lower accuracy (around 0.87) and F1-score (around 0.62) compared to other models, suggesting they might be less powerful for this task.\n",
    "5. KNN: Has high precision (0.912) but lower recall (0.406), indicating it might correctly identify non-defaulters but miss some actual defaulters.\n",
    "6. SVM: Has high precision (0.918) but very low recall (0.219), similar to KNN but with even more missed defaulters.\n",
    "7. Naive Bayes and Logistic Regression: Have the lowest accuracy and F1-score among all models.\n",
    "\n",
